import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [backendStatus, setBackendStatus] = useState('Loading...');
  const [databaseStatus, setDatabaseStatus] = useState('Loading...');
  const [testData, setTestData] = useState(null);
  const [healthData, setHealthData] = useState(null);

  useEffect(() => {
    // Test backend connection
    fetch('/api/test')
      .then(response => response.json())
      .then(data => {
        setTestData(data);
        setBackendStatus('Connected ‚úÖ');
      })
      .catch(error => {
        console.error('Backend connection failed:', error);
        setBackendStatus('Failed ‚ùå');
      });

    // Test health endpoint (includes database status)
    fetch('/api/health')
      .then(response => response.json())
      .then(data => {
        setHealthData(data);
        setDatabaseStatus(data.database === 'connected' ? 'Connected ‚úÖ' : 'Disconnected ‚ùå');
      })
      .catch(error => {
        console.error('Health check failed:', error);
        setDatabaseStatus('Failed ‚ùå');
      });
  }, []);

  const testDatabase = async () => {
    try {
      const response = await fetch('/api/db-test');
      const data = await response.json();
      if (data.status === 'success') {
        setDatabaseStatus('Connected ‚úÖ');
        alert('Database connection successful!');
      } else {
        setDatabaseStatus('Failed ‚ùå');
        alert('Database connection failed!');
      }
    } catch (error) {
      setDatabaseStatus('Failed ‚ùå');
      alert('Database test failed!');
    }
  };

  const initDatabase = async () => {
    try {
      const response = await fetch('/api/init-db', { method: 'POST' });
      const data = await response.json();
      if (data.status === 'success') {
        alert('Database initialized successfully!');
      } else {
        alert('Database initialization failed!');
      }
    } catch (error) {
      alert('Database initialization failed!');
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>üöÄ HRMS System</h1>
        <p>Human Resource Management System</p>
      </header>

      <main className="container">
        <div className="card">
          <h2>System Status</h2>
          <div className="status-grid">
            <div className="status-item">
              <strong>Frontend:</strong> Running ‚úÖ
            </div>
            <div className="status-item">
              <strong>Backend:</strong> {backendStatus}
            </div>
            <div className="status-item">
              <strong>Database:</strong> {databaseStatus}
            </div>
          </div>

          <div className="action-buttons">
            <button className="btn btn-primary" onClick={testDatabase}>
              Test Database Connection
            </button>
            <button className="btn btn-secondary" onClick={initDatabase}>
              Initialize Database
            </button>
          </div>
        </div>

        {testData && (
          <div className="card">
            <h2>Backend Test Response</h2>
            <pre>{JSON.stringify(testData, null, 2)}</pre>
          </div>
        )}

        {healthData && (
          <div className="card">
            <h2>Health Check Response</h2>
            <pre>{JSON.stringify(healthData, null, 2)}</pre>
          </div>
        )}

        <div className="card">
          <h2>Next Steps</h2>
          <ul>
            <li>‚úÖ Basic project structure created</li>
            <li>‚úÖ Backend server running</li>
            <li>‚úÖ Frontend React app running</li>
            <li>‚úÖ Environment variables configured</li>
            <li>‚è≥ PostgreSQL installation & setup</li>
            <li>‚è≥ Database connection & tables</li>
            <li>‚è≥ Authentication system</li>
            <li>‚è≥ Employee management module</li>
            <li>‚è≥ Dashboard implementation</li>
          </ul>
        </div>
      </main>
    </div>
  );
}

export default App;
